 &lt;p&gt;因为摆烂好久了，天天不学习，试试在这打卡能不能让自己好好学习，这个打卡日记不会一直在的，但是至少明年的时候还在，应该到明年我就把这个打卡下了哈哈哈哈，因为我要是把这个博客放简历里的话我是不想让公司的人看到我的打卡日记的。&lt;/p&gt;
&lt;p&gt;以前也是有好好打卡的，试过很多地方，不过都是在校时候的事情了。试过在本子上，我小本本都写好几本了，写的贼详细，几乎每天都写对于以前的我还是蛮有效果的。&lt;/p&gt;
&lt;p&gt;一些好习惯啊不能丢的呀，例如：记账、睡前看书、不带手机上床、看电影、番茄学习法（休息时间可以上个厕所啊，看十几分钟其他书啊，或者搞卫生走走啊都行）。。。。&lt;/p&gt;
